        <nav>
          {username &&(<>
          <Link>Create New post</Link>
          <Link>Logout</Link>
          </>)}


          {!username &&(<>
          <Link to={'/Login'}>Login</Link>
          <Link to={'/Register'}>Register</Link>
          </>)}
 
        </nav>
      </header>
    )
}
